def solution(stdin: str) -> str:
    n = int(stdin)
    edges = [set() for _ in range(n + 1)]
    for _ in range(n - 1):
        a, b = [int(x) for x in stdin.split()]
        edges[a].add(b)
        edges[b].add(a)

    def get_max_simple_path(v1: int, v2: int, edges: List[Set[int]]) -> int:
        if v1 == v2:
            return 1
        if not edges[v1]:
            return 0
        max_simple_path = 0
        for v in edges[v1]:
            if v not in edges[v2]:
                continue
            max_simple_path = max(max_simple_path, get_max_simple_path(v, v2, edges) + 1)
        return max_simple_path

    max_simple_path = 0
    for v1, v2 in combinations(range(1, n), 2):
        max_simple_path = max(max_simple_path, get_max_simple_path(v1, v2, edges))

    if max_simple_path == 0:
        return "NO"

    max_simple_path -= 1
    answers = []
    for v1, v2, v3 in permutations(range(1, n), 3):
        if max_simple_path == 0:
            break
        if get_max_simple_path(v1, v2, edges) + get_max_simple_path(v2, v3, edges) + get_max_simple_path(v1, v3, edges) >= max_simple_path:
            answers.append(v1)
            answers.append(v2)
            answers.append(v3)
            break
    return str(max_simple_path) + "\n" + " ".join([str(x) for x in answers])

