def solution(stdin: str) -> str:
    n, h, l, r = map(int, stdin.strip().split())
    nums = [int(x) for x in stdin.strip().split()]

    # dp[i][j]: the number of good sleeping times for i sleeping times
    dp = [[0 for _ in range(n + 1)] for _ in range(h + 1)]

    # the maximum number of good sleeping times in the first i sleeping times
    for i in range(1, h + 1):
        for j in range(n):
            if nums[j] >= i:
                # the time is good
                dp[i][j + 1] = dp[i - 1][j] + 1
            else:
                dp[i][j + 1] = dp[i - 1][j]

    # the maximum number of good sleeping times in the first i sleeping times, and j sleeping times
    result = 0
    for i in range(h):
        for j in range(n):
            if nums[j] <= i:
                # the time is not good
                result = max(result, dp[i][j])
            else:
                # the time is good
                result = max(result, dp[i][j] + 1)

    return str(result)


