import sys
from io import StringIO


class Brainfuck:
    def __init__(self, exp: str):
        self.exp = exp
        self.raw_stack = []
        self.stack = []
        self.raw_pointer = 0
        self.pointer = 0

    def step(self, command: str):
        if command == '<':
            self.pointer += 1
            if self.pointer >= len(self.stack):
                self.stack.append(0)
        elif command == '>':
            self.pointer -= 1
            if self.pointer < 0:
                self.stack.append(0)
        elif command == '-':
            self.stack[self.pointer] -= 1
            if self.stack[self.pointer] < 0:
                self.stack[self.pointer] = 255
        elif command == '+':
            self.stack[self.pointer] += 1
            if self.stack[self.pointer] > 255:
                self.stack[self.pointer] = 0
        elif command == '[':
            if self.stack[self.pointer] == 0:
                count = 1
                while count > 0:
                    self.pointer += 1
                    if self.pointer >= len(self.stack):
                        self.stack.append(0)
                    if self.stack[self.pointer] == 0:
                        count -= 1
        elif command == ']':
            if self.stack[self.pointer]!= 0:
                count = 1
                while count > 0:
                    self.pointer -= 1
                    if self.pointer < 0:
                        self.stack.append(0)
                    if self.stack[self.pointer]!= 0:
                        count -= 1
        elif command == '.':
            sys.stdout.write(chr(self.stack[self.pointer]))
        elif command == ',':
            self.raw_stack.append(self.stack[self.pointer])
        elif command == '[' or command == ']':
            self.raw_pointer += 1
            if self.raw_pointer >= len(self.raw_stack):
                self.raw_stack.append(0)
            self.raw_pointer -= 1
        else:
            pass

    def run(self):
        while self.raw_pointer < len(self.raw_stack):
            self.step(self.raw_stack[self.raw_pointer])
            self.raw_pointer += 1
        print(self.stack)


