        if current_passengers <= remaining_capacity:
            return True
        return False

    def find_last_stop(last_stop: int, a: List[int]) -> int:
        for i in range(len(a) - 1, -1, -1):
            if a[i] > last_stop:
                return i
        return 0

    n, w = map(int, stdin.split())
